import CustomImage from "./CustomImage";

export default function RecipeCard() {
  return (
    <div className="recipe-card">
      <CustomImage imgSrc="/img/gallery/img_1.jpeg" pt="65%" />
      <div className="recipe-card-info">
          <img className="author-img" src="/img/top-chefs/img_1.jpeg" alt="" />
          <p>Chicken Pan Pizza</p>
      </div>
    </div>
  );
}
